import React from 'react'
import {connect} from 'react-redux'

const Home = (props) =>{
  return(
    <h1>Your Email is {props.user.email}</h1>
  )
}

function mapStateToProps(state){
  return {
    user: state.user
  }
}

export default connect(mapStateToProps)(Home)
